Likelihood_acc <- function(value)
{
	if (!isnull(.self$.cobj)) {
		if (missing(value)) {
			so_OFMeasures_get_Likelihood(.self$.cobj)
		} else {
			if (!is(value, "numeric")) {
				stop("object must be of type 'numeric'")
			}
			so_OFMeasures_set_Likelihood(.self$.cobj, value)
		}
	}
}

